import React from "react";
import { Suspense } from "react";

import "./App.css";
const LazyLogIn = React.lazy(() => import("./Pages/LogInPage"));

const num: number = 2;
function App() {
  return (
    <div className="div-app">
      <Suspense fallback="Loading...">
        <LazyLogIn num={num} />
      </Suspense>
    </div>
  );
}

export default App;
